import React from 'react';
import { useTasks } from '../contexts/TaskContext';
import { BarChart, PieChart } from 'react-chartjs-2';
import { Chart as ChartJS, ArcElement, Tooltip, Legend, CategoryScale, LinearScale, BarElement, Title } from 'chart.js';
import { CalendarIcon, CheckIcon, ClockIcon } from '@radix-ui/react-icons';

ChartJS.register(ArcElement, Tooltip, Legend, CategoryScale, LinearScale, BarElement, Title);

const StatsDashboard = () => {
  const { stats } = useTasks();

  if (!stats) return <div className="text-center py-8">Loading statistics...</div>;

  const taskCompletionData = {
    labels: ['Completed', 'Remaining'],
    datasets: [
      {
        data: [stats.tasks.completed, stats.tasks.total - stats.tasks.completed],
        backgroundColor: ['#10b981', '#6b7280'],
        borderWidth: 1,
      },
    ],
  };

  const focusTimeData = {
    labels: ['Focus Time'],
    datasets: [
      {
        label: 'Minutes',
        data: [stats.sessions.totalFocusMinutes],
        backgroundColor: ['#4f46e5'],
      },
    ],
  };

  return (
    <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
      <div className="card bg-base-200 shadow-md">
        <div className="card-body">
          <h2 className="card-title">Task Statistics</h2>
          <div className="grid grid-cols-3 gap-4 mb-6">
            <div className="stat">
              <div className="stat-figure text-primary">
                <CheckIcon className="w-8 h-8" />
              </div>
              <div className="stat-title">Tasks Completed</div>
              <div className="stat-value">{stats.tasks.completed}</div>
              <div className="stat-desc">out of {stats.tasks.total}</div>
            </div>
            <div className="stat">
              <div className="stat-figure text-secondary">
                <CalendarIcon className="w-8 h-8" />
              </div>
              <div className="stat-title">Completion Rate</div>
              <div className="stat-value">{Math.round(stats.tasks.completionRate)}%</div>
              <div className="stat-desc">of all tasks</div>
            </div>
            <div className="stat">
              <div className="stat-figure text-accent">
                <ClockIcon className="w-8 h-8" />
              </div>
              <div className="stat-title">Focus Time</div>
              <div className="stat-value">{stats.sessions.totalFocusMinutes}</div>
              <div className="stat-desc">minutes</div>
            </div>
          </div>
          <div className="h-64">
            <PieChart data={taskCompletionData} />
          </div>
        </div>
      </div>
      <div className="card bg-base-200 shadow-md">
        <div className="card-body">
          <h2 className="card-title">Focus Sessions</h2>
          <div className="h-64">
            <BarChart 
              data={focusTimeData}
              options={{
                responsive: true,
                plugins: {
                  legend: {
                    display: false,
                  },
                  title: {
                    display: true,
                    text: 'Total Focus Minutes',
                  },
                },
              }}
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default StatsDashboard;
